import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import './Header.css';

function Header({ darkMode, toggleDarkMode }) {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <header className={menuOpen ? 'menu-open' : ''}>
      <div className="container header-content">
        <h1 className="logo">
          <span className="material-icons">computer</span>
          <span className="logo-text">IT Solutions Architect</span>
        </h1>
        <button className="menu-toggle" onClick={toggleMenu}>
          <span className="material-icons">{menuOpen ? 'close' : 'menu'}</span>
        </button>
        <nav className={`main-nav ${menuOpen ? 'open' : ''}`}>
          <ul>
            <li><NavLink to="/" end onClick={() => setMenuOpen(false)}><span className="material-icons">home</span> Home</NavLink></li>
            <li><NavLink to="/services" onClick={() => setMenuOpen(false)}><span className="material-icons">build</span> Services</NavLink></li>
            <li><NavLink to="/about" onClick={() => setMenuOpen(false)}><span className="material-icons">info</span> About</NavLink></li>
            <li><NavLink to="/contact" onClick={() => setMenuOpen(false)}><span className="material-icons">email</span> Contact</NavLink></li>
          </ul>
        </nav>
        <button onClick={toggleDarkMode} className="dark-mode-toggle">
          <span className="material-icons">{darkMode ? 'light_mode' : 'dark_mode'}</span>
        </button>
      </div>
    </header>
  );
}

export default Header;
